    <script>
        let currentZoom = 1.0;
        const minZoom = 0.3;
        const maxZoom = 3.0;
        
        function zoomIn() {
            currentZoom = Math.min(currentZoom + 0.1, maxZoom);
            applySvgZoom();
        }
        
        function zoomOut() {
            currentZoom = Math.max(currentZoom - 0.1, minZoom);
            applySvgZoom();
        }
        
        function resetZoom() {
            // Calcola zoom ottimale basato su orientamento e dimensioni
            const isLandscape = window.innerWidth > window.innerHeight;
            const aspectRatio = window.innerWidth / window.innerHeight;
            
            if (isLandscape && aspectRatio > 1.5) {
                // Per schermi molto larghi
                currentZoom = 1.0;
            } else if (window.innerWidth >= 1600) {
                currentZoom = 1.2;
            } else if (window.innerWidth >= 1200) {
                currentZoom = 1.1;
            } else if (window.innerWidth <= 768) {
                currentZoom = 0.9;
            } else {
                currentZoom = 1.0;
            }
            applySvgZoom();
        }
        
        function applySvgZoom() {
            const svg = document.querySelector('svg');
            if (svg) {
                svg.style.transform = `scale(${currentZoom})`;
                
                // Adatta il container dinamicamente
                const container = document.getElementById('pageContainer');
                const isLandscape = window.innerWidth > window.innerHeight;
                
                if (isLandscape) {
                    container.style.maxWidth = '99vw';
                    container.style.maxHeight = '96vh';
                } else {
                    if (currentZoom > 1.2) {
                        container.style.maxWidth = '98vw';
                        container.style.maxHeight = '95vh';
                    } else {
                        container.style.maxWidth = '96vw';  
                        container.style.maxHeight = '92vh';
                    }
                }
            }
        }
        
        // Keyboard zoom controls
        document.addEventListener('keydown', function(e) {
            if (e.key === '+' || e.key === '=') {
                e.preventDefault();
                zoomIn();
            } else if (e.key === '-') {
                e.preventDefault();
                zoomOut();
            } else if (e.key === '0') {
                e.preventDefault();
                resetZoom();
            }
        });
        
        // Mouse wheel zoom
        document.addEventListener('wheel', function(e) {
            if (e.ctrlKey) {
                e.preventDefault();
                if (e.deltaY < 0) {
                    zoomIn();
                } else {
                    zoomOut();
                }
            }
        });
        
        // Initialize zoom based on screen size and orientation
        document.addEventListener('DOMContentLoaded', function() {
            resetZoom();
        });
        
        // Handle window resize
        window.addEventListener('resize', function() {
            resetZoom();
        });
    </script>
